css:
.gitlab {
  min-width: 260px;
}
.gitlab .gitlab-title {
  display: flex;
  flex-direction: row;
  align-content: space-between;
}
.gitlab .gitlab-title h4 {
  display: flex;
  flex: 1;
  margin: 5px 0;
  padding: 5px;
  line-height: 16px;
}
.gitlab .gitlab-title .badge {
  display: flex;
  margin: 5px 0;
  line-height: 16px;
}
.gitlab .gitlab-projects-count {
  float: right;
}
